exports=async function(bid,options){const{parseCatalogPaginate,cleanCatalogWrapper}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`http://www.ddxs.vip/book/${bid}${1===page?"":"_"+page}/`,".section-list",{...options,clientOptions,pageSize:120,totalPagesRegex:/value="\/book\/\d+_(?<totalPages>\d+)\/">[^<]+<\/option>\s*<\/select/})};